// App.js
import React from 'react';
import SwipeableContainer from './components/SwipeableContainer';
import LikedTrendsPage from './components/LikedTrendsPage';import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';


// Define initialTrends here or import it from another module
const initialTrends = [
  { name: 'Flared Jeans', image: process.env.PUBLIC_URL + '/images/image1.jpeg' },
  { name: 'Bodycon Dresses', image: process.env.PUBLIC_URL + '/images/image2.jpeg' },
  { name: 'ChunkyLongBoots', image: process.env.PUBLIC_URL + '/images/image3.jpeg' },
  { name: 'Oversized Sweater', image: process.env.PUBLIC_URL + '/images/image4.jpeg' },
  // Add more trend data
];

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/" exact>
          <SwipeableContainer trends={initialTrends} />
        </Route>
        <Route path="/liked-trends">
          <LikedTrendsPage />
        </Route>
      </Switch>
    </Router>
  );
};

export default App;
